import { useEffect, useState } from 'react';
import './App.css';

function App() {
  const [resp, setResp] = useState([])

  fetch('https://jsonplaceholder.typicode.com/todos/1')
        .then(response => {
          return response.json()
        })
        .then
        .catch(e => console.log(e))



  useEffect(() => {
     setResp()
  }, [resp])


  return (
    <div className="App">
     {resp.map((json) => {
       return <p key={json.id}>json</p>
     })}
    </div>
  );
}

export default App;
